<script>
function submitCalendar(day,mth,yr)
{
	parent.getEvents(day,mth,yr);
}
function NavigateCalendar(mth,yr,dir)
{
	var mthVal = 0;
	var yrVal = 0;
	if(dir == "prev")
	{
		if(mth == '01')
		{
			mthVal = '12';
			yrVal = yr-1;
		}
		else
		{
			mthVal = mth -1;
			yrVal = yr;
		}
	}
	if(dir == "next")
	{
		if(mth == '12')
		{
			mthVal = '01';
			yrVal = yr+1;
		}
		else
		{
			mthVal = mth +1;
			yrVal = yr;
		}
	}
	document.eventCalendar.month.value = mthVal;
	document.eventCalendar.year.value = yrVal;
	document.eventCalendar.emonth.value = mthVal;
	document.eventCalendar.year.value = yrVal;
	document.eventCalendar.submit();
}
</script>
